import React, { Fragment } from "react"
import {navData} from "../router/index"
import {NavLink} from "react-router-dom"
console.log(navData)
function Nav(){
    return(
        <Fragment>
            {navData.map((item)=>{
                <NavLink
                    to={item.path}
                ></NavLink>
            })}
        </Fragment>
        
    )
}

export default Nav;
